insert into LivLivros values (default, 'Drácula','Bram Stoker','Darkside',2018,'O jovem advogado Jonathan Harker viaja até a Transilvânia para tratar de negócios com o enigmático Conde Drácula. Logo, eventos estranhos e sombrios começam a ocorrer quando o conde se muda para Londres, espalhando terror e despertando a luta de um grupo determinado a detê-lo.',2, 1, '');
insert into LivLivros values (default, 'O Médico e o Monstro (O estranho caso do Dr. Jekyll and Sr. Hyde)','Robert Louis Stevenson','Penguin-Companhia',2015,'Em meio à Londres vitoriana, o respeitável Dr. Henry Jekyll realiza experimentos para separar o bem e o mal dentro de si. O resultado é o surgimento de Edward Hyde, uma figura sombria e violenta que assume sua identidade à noite. A narrativa, envolta em mistério e suspense, questiona os limites entre moralidade, ciência e a verdadeira natureza humana.',3, 1, '');
insert into LivLivros values (default, 'A Morte de Ivan Ilitch','Liev Tolstói','Editora 34',2009,'A descoberta da morte iminente leva um burocrata russo a repensar sua vida.',4, 1, '');
insert into LivLivros values (default, 'Neuromancer','William Gibson','Aleph',2003,'Um hacker é recrutado para um ataque cibernético em um futuro distópico.',5, 1, '');
insert into LivLivros values (default, 'O Caçador de Pipas','Khaled Hosseini','Nova Fronteira',2007,'A história de amizade e redenção entre dois garotos no Afeganistão.',6, 1, '');
insert into LivLivros values (default, 'Tudo se Ilumina','Jonathan Safran Foer','Rocco',2022,'Um jovem busca a mulher que salvou seu avô durante a guerra na Ucrânia.',7, 1, '');
insert into LivLivros values (default, 'Extraordinário','R.J. Palacio','Intrínseca',2013,'August "Auggie" Pullman nasceu com uma síndrome genética que deformou seu rosto. Depois de anos sendo educado em casa, ele ingressa na 5ª série em uma escola regular. O livro alterna entre a perspectiva de Auggie (que enfrenta bullying e medo dos colegas), sua irmã Via (que lida com o ciúme e a culpa) e amigos como Jack e Summer. A história celebra a bondade e a resiliência, mostrando como Auggie transforma sua comunidade. A frase central - "Quando tiver que escolher entre estar certo e ser gentil, escolha ser gentil" - resume seu tema.',8, 1, '');
insert into LivLivros values (default, 'Os 13 Porquês','Jay Asher','Ática',2017,'Clay Jensen recebe uma caixa com fitas cassete gravadas por Hannah Baker, sua colega que cometeu suicídio duas semanas antes. Nas fitas, Hannah explica os treze motivos que a levaram à decisão - incluindo boatos cruéis, traição de amigos e assédio sexual. Cada fita é destinada a uma pessoa específica envolvida em sua dor. Enquanto Clay ouve as gravações e percorre os locais mencionados, ele confronta sua própria culpa por não ter ajudado Hannah. O livro aborda bullying, depressão e o impacto das nossas ações nos outros.',9, 1, '');
insert into LivLivros values (default, 'O Ódio que Você Semeia','Angie Thomas','Galera Record',2018,'Starr Carter, uma garota negra de 16 anos, testemunha o assassinato de seu melhor amigo, Khalil, por um policial branco. Dividida entre seu bairro periférico e a escola elitista que frequenta, Starr é pressionada a falar sobre o crime, tornando-se o centro de um caso que divide os EUA. Enquanto protestos e violência explodem, ela precisa encontrar sua voz para lutar por justiça - mesmo que isso coloque sua família em perigo. Baseado no movimento Black Lives Matter, o livro é um retrato cru do racismo estrutural.',10, 1, '');
insert into LivLivros values (default, 'A Náusea','Jean-Paul Sartre','Nova Fronteira',2019,'Um intelectual experimenta o absurdo da existência em sua vida cotidiana.',11, 1, '');
insert into LivLivros values (default, 'O Estrangeiro','Albert Camus','Record',1979,'Meursault vive alienado das normas sociais até cometer um assassinato.',12, 1, '');
insert into LivLivros values (default, 'A Revolução dos Bichos','George Orwell','Companhia das Letras',2007,'Uma sátira sobre o totalitarismo, usando uma fazenda de animais como alegoria política.',13, 1, '');
insert into LivLivros values (default, 'Coraline e o Mundo Secreto','Neil Gaiman','Intrínseca',2020,'Coraline, ao se mudar para um novo apartamento, encontra uma porta trancada que a leva a um mundo paralelo, com pais que parecem perfeitos e um ambiente que parece perfeito, mas que esconde perigos e uma conspiração sinistra. ',14, 1, '');
insert into LivLivros values (default, 'O Hobbit ','J.R.R. Tolkien','HarperCollins',2019,'Bilbo Bolseiro é um hobbit pacato que vive tranquilamente no Condado, até que é surpreendido por uma visita de Gandalf e treze anões. Convidado a participar de uma jornada para recuperar um tesouro guardado por um dragão, Bilbo descobre coragem, astúcia e um mundo vasto e perigoso além de sua toca.',15, 1, '');
insert into LivLivros values (default, 'As Crônicas de Nárnia','C.S. Lewis','WMF Martins Fontes',2009,'Série de fantasia que segue as aventuras de crianças no mundo mágico de Nárnia, onde animais falam, magia é real e o bem luta contra o mal.',16, 1, '');
insert into LivLivros values (default, 'Percy Jackson e os Olimpianos','Rick Riordan','Intrínseca',2014,'Percy Jackson, um garoto com TDAH e dislexia, descobre ser um semideus, filho de Poseidon. Ele é levado para o Acampamento Meio-Sangue, onde treina com outros filhos de deuses gregos. Quando o Raio Mestre de Zeus é roubado, Percy é acusado e tem até o solstício de verão para provar sua inocência. Em uma missão com Annabeth (filha de Atena) e Grover (um sátiro), ele enfrenta monstros mitológicos como a Medusa e o Minotauro, enquanto descobre uma conspiração que ameaça o Olimpo. O livro mistura mitologia grega com humor e aventura moderna.',17, 1, '');
insert into LivLivros values (default, 'Harry Potter e a Pedra Filosofal','J. K. Rowling','Rocco',2000,'Um garoto órfão descobre no seu aniversário de 11 anos que é um bruxo e começa a estudar em uma escola de magia. Lá, encontra amizade, aventuras e mistérios sobre seu passado.',18, 1, '');
insert into LivLivros values (default, 'Harry Potter e a Câmara Secreta','J. K. Rowling','Rocco',2000,'No segundo ano em Hogwarts, eventos misteriosos colocam os alunos em perigo. Harry e seus amigos tentam descobrir a verdade sobre uma antiga lenda da escola.',19, 1, '');
insert into LivLivros values (default, 'Harry Potter e o Prisioneiro de Azkaban','J. K. Rowling','Rocco',2001,'Um perigoso prisioneiro foge e parece estar atrás de Harry. Ao mesmo tempo, o passado de sua família começa a vir à tona.',20, 1, '');
insert into LivLivros values (default, 'Harry Potter e o Cálice de Fogo','J. K. Rowling','Rocco',2001,'Hogwarts sedia um torneio entre escolas de magia, e Harry acaba envolvido sem saber como. O desafio traz perigos crescentes e novas ameaças.',21, 1, '');
insert into LivLivros values (default, 'Harry Potter e a Ordem da Fênix','J. K. Rowling','Rocco',2003,'Ignorado pelo Ministério da Magia, Harry enfrenta desconfiança e opressão, enquanto uma sociedade secreta se organiza contra o retorno das trevas.',22, 1, '');
insert into LivLivros values (default, 'Harry Potter e o Enigma do Príncipe','J. K. Rowling','Rocco',2006,'Com a guerra mágica se aproximando, Harry descobre segredos do passado do vilão e busca entender como derrotá-lo.',23, 1, '');
insert into LivLivros values (default, 'Harry Potter e as Relíquias da Morte','J. K. Rowling','Rocco',2007,'A batalha final se aproxima. Harry parte em uma jornada perigosa para destruir as últimas peças do poder do inimigo.',24, 1, '');
insert into LivLivros values (default, 'O Senhor dos Anéis','J.R.R. Tolkien','HarperCollins ',2021,'Apesar de ter sido publicado em três volumes – "A Sociedade do Anel", "As Duas Torres" e "O Retorno do Rei" – desde os anos 1950, O Senhor dos Anéis não é exatamente uma trilogia, mas um único grande romance que só pode ser compreendido em seu conjunto, segundo a concepção de seu autor, J.R.R. Tolkien. Em volume único, essa edição suntuosa da obra-prima de Tolkien, ilustrada em aquarela pelo aclamado e premiado artista Alan Lee e abrigada em uma caixa transparente, é uma das mais completas edições já publicadas.',25, 1, '');
insert into LivLivros values (default, 'Corte de Espinhos e Rosas','Sarah J. Maas','Galera Record',2016,'Feyre Archeron, uma caçadora humana, mata um lobo na floresta - que na verdade era uma fada. Como punição, ela é levada para Prythian, o reino das fadas, pelo alto lorde Tamlin. Inicialmente prisioneira, Feyre descobre que uma maldição paira sobre Tamlin e seu povo, e que apenas uma humana quebrando o feitiço pode salvá-los. Enquanto se apaixona por Tamlin, Feyre enfrenta provas mortais na Corte da Noite, governada pelo enigmático Rhysand. O livro mistura romance, política fae e ação, com um protagonista feminina forte.',26, 1, '');
insert into LivLivros values (default, 'Ascensão das Trevas (Vol.1)','C. S. Pacat','VR Editora',2022,'Will é um jovem fugitivo que descobre estar ligado a uma antiga guerra entre luz e trevas. Ele se junta a um grupo de guardiões secretos e passa a treinar para enfrentar o mal que ameaça retornar.',27, 1, '');
insert into LivLivros values (default, 'Herdeiro das Trevas (Vol.2)','C. S. Pacat','VR Editora',2024,'Após revelações chocantes sobre seu passado, Will precisa lidar com consequências devastadoras enquanto o mundo mergulha cada vez mais na escuridão. Velhos mitos ganham vida, e as escolhas dos personagens moldarão o futuro do mundo.',28, 1, '');
insert into LivLivros values (default, 'A Guerra da Papoula (Vol. 1)','R.F. Kuang','Intrínseca',2022,'Rin é uma jovem pobre e órfã que consegue ingressar na mais prestigiada academia militar do Império de Nikan. Lá, ela descobre ter um poder ancestral ligado aos deuses — e um papel sombrio em meio a uma guerra brutal. Inspirado na história da China e nas Guerras do Ópio, o livro mistura fantasia sombria com críticas políticas e sociais.',29, 1, '');
insert into LivLivros values (default, 'A República do Dragão (Vol. 2)','R.F. Kuang','Intrínseca',2023,'O segundo livro da trilogia A Guerra da Papoula segue Rin em sua jornada para lutar contra um império opressor e destruidor. Após os eventos devastadores da primeira guerra, Rin se une a forças rebeldes na tentativa de derrubar a tirania, mas logo descobre que os maiores inimigos são os próprios aliados e seus próprios limites. O livro mistura ação militar, estratégia e elementos de magia ancestral.',30, 1, '');
insert into LivLivros values (default, 'A Deusa em Chamas (Vol.3)','R.F. Kuang','Intrínseca',2023,'O terceiro e último volume da série A Guerra da Papoula segue Rin enquanto ela se torna uma figura central no confronto final entre as forças rebeldes e o império. Com sua ascensão a um poder quase divino, ela luta com questões de identidade, moralidade e o sacrifício necessário para alcançar a vitória. O livro conclui a jornada com uma reflexão intensa sobre o custo da guerra e os limites do poder.',31, 1, '');
insert into LivLivros values (default, 'O Príncipe Cruel (Vol.1 O povo do Ar )','Holly Black','Galera Record ',2018,'Jude, uma garota humana criada no perigoso reino das fadas, enfrenta desprezo e humilhações, mas está determinada a conquistar poder. Em meio a intrigas políticas e rivalidades, ela entra num jogo perigoso envolvendo o cruel príncipe Cardan.',32, 1, '');
insert into LivLivros values (default, 'O Rei Perverso (Vol.2 O povo do Ar )','Holly Black','Galera Record ',2020,'Agora no centro do poder, Jude deve lidar com traições, jogos de inteligência e sentimentos conflitantes por Cardan, enquanto tenta manter o controle sobre o trono. Quanto mais ela sobe, mais perigosa se torna a queda.',33, 1, '');
insert into LivLivros values (default, 'A Rainha do Nada (Vol.3 O povo do Ar )','Holly Black','Galera Record ',2020,'Exilada, Jude precisa decidir se quer retomar seu lugar ou abandonar tudo. À medida que forças sombrias ameaçam Elfhame, ela será forçada a encarar suas decisões, seu poder e seu verdadeiro sentimento por Cardan.',34, 1, '');
insert into LivLivros values (default, 'O Conde de Monte Cristo','Alexandre Dumas','Martin Claret',2017,'Um homem busca vingança após ser traído e preso injustamente.',1, 1, '');
insert into LivLivros values (default, 'Flores para Algernon','Daniel Keyes','Aleph',2024,'Charlie Gordon, um homem com deficiência intelectual, se submete a um experimento científico que promete aumentar sua inteligência. Conforme o tratamento avança, Charlie ultrapassa todos os limites intelectuais — mas também começa a compreender aspectos dolorosos da vida e da natureza humana. A história é contada por meio dos relatórios escritos por ele, refletindo sua transformação e regressão.',35, 1, '');
insert into LivLivros values (default, 'Jogos Vorazes (Livro 1)','Suzanne Collins','Rocco',2010,'Num futuro pós-apocalíptico, a nação de Panem (antiga América do Norte) é dividida em 12 distritos controlados pelo opressivo Capitólio. Como punição por uma rebelião passada, cada distrito deve enviar dois "tributos" adolescentes para os Jogos Vorazes - uma competição mortal televisionada. Quando sua irmã é sorteada, Katniss Everdeen, do Distrito 12, se voluntaria no lugar dela. Ao lado do colega Peeta Mellark, ela usa sua habilidade com arco e astúcia para sobreviver, tornando-se inadvertidamente o símbolo de uma revolução que pode destruir o Capitólio.',36, 1, '');
insert into LivLivros values (default, 'Em Chamas (Livro 2)','Suzanne Collins','Rocco',2011,'Após vencer os 74° Jogos Vorazes, Katniss descobre que sua atitude desafiadora incitou motins em vários distritos. O Capitólio anuncia um torneio especial com vencedores passados, forçando Katniss a voltar à arena. Durante os jogos, ela descobre uma aliança secreta entre alguns tributos e percebe que a rebelião é real. Quando Peeta é capturado pelo Capitólio, Katniss é resgatada pelos rebeldes do Distrito 13 - um distrito que todos acreditavam destruído. Agora, ela precisa decidir se assume seu papel como "Tordo", o símbolo da revolução.',37, 1, '');
insert into LivLivros values (default, 'A Esperança (Livro 3)','Suzanne Collins','Rocco',2012,'Katniss, agora no Distrito 13, concorda em ser o "Tordo" da rebelião, mas sofre com PTSD e a ausência de Peeta - que foi torturado e reprogramado para odiá-la. Enquanto as forças rebeldes avançam, Katniss forma um esquadrão para filmar propaganda de guerra, mas seu verdadeiro objetivo é assassinar a Presidente Snow. Na batalha final pelo Capitólio, uma tragédia pessoal faz Katniss questionar todos os lados da guerra. Após a vitória, ela retorna a um Distrito 12 devastado, onde finalmente reconstrói sua vida ao lado de Peeta, cujas memórias começam a voltar.',38, 1, '');
insert into LivLivros values (default, 'Divergente (Livro 1)','Veronica Roth','Rocco',2012,'Numa Chicago futurista, a sociedade é dividida em cinco facções baseadas em virtudes: Audácia (coragem), Erudição (inteligência), Amizade (paz), Franqueza (honestidade) e Abnegação (altruísmo). Beatrice Prior, uma Abnegada, descobre no teste de aptidão que é Divergente - alguém que não se encaixa em nenhuma facção, uma ameaça ao sistema. Ela escolhe se juntar à Audácia, onde conhece Tobias "Quatro" Eaton, seu instrutor misterioso. Enquanto supera treinamentos brutais, Beatrice (agora Tris) descobre um plano genocida da Erudição e precisa usar sua divergência para salvar aqueles que ama.',39, 1, '');
insert into LivLivros values (default, 'Insurgente (Livro 2)','Veronica Roth','Rocco',2013,'Após o golpe da Erudição, Tris e Tobias fogem pela cidade em busca de aliados. Enquanto facções se dissolvem e guerras civis eclodem, Tris luta contra a culpa por ter matado um amigo e descobre que sua mãe tinha segredos ligados aos Divergentes. A busca por respostas leva ao quartel-general da Franqueza, onde um arquivo secreto revela a verdade chocante: Chicago é um experimento social, e os Divergentes são a chave para sua reintegração ao mundo exterior. Com a cidade à beira do colapso, Tris precisa decidir se revela a verdade - mesmo que isso custe sua vida.',40, 1, '');
insert into LivLivros values (default, 'Convergente (Livro 3)','Veronica Roth','Rocco',2014,'Após a revelação sobre Chicago, a cidade é dividida entre os que querem cruzar a fronteira e os que desejam ficar. Tris, Tobias e seus amigos se infiltram no complexo da Agência que controla o experimento, liderada pelo manipulador David. Lá, Tris descobre que seu sacrifício é necessário para desativar a barreira que isola a cidade. Em uma reviravolta final, Tris se sacrifica para libertar Chicago, deixando Tobias devastado. O epílogo mostra um futuro onde a sociedade tenta se reconstruir sem facções, com Tobias honrando a memória de Tris.',41, 1, '');
insert into LivLivros values (default, 'Quatro: Um Livro Divergente','Veronica Roth','Rocco',2015,'Esta coletânea de contos narra a história de Tobias Eaton antes de conhecer Tris. Abusado por seu pai na Franqueza, ele foge para a Audácia aos 16 anos, onde ganha o apelido "Quatro". Os contos mostram seu treinamento brutal, seu medo secreto (que o levou a escolher esse nome) e seu trabalho infiltrado na Erudição para investigar seus planos. A última parte do livro recria cenas de "Divergente" sob a perspectiva de Tobias, revelando seus sentimentos por Tris desde o início. Um complemento essencial para entender um dos personagens mais complexos da saga.',42, 1, '');
insert into LivLivros values (default, '1984','George Orwell','Companhia das Letras',2009,'Uma distopia que explora um regime totalitário e a vigilância constante do Estado.',43, 1, '');
insert into LivLivros values (default, 'Admirável Mundo Novo','Aldous Huxley','Biblioteca Azul',2014,'Uma sociedade futura com controle absoluto sobre as pessoas e a felicidade artificial.',44, 1, '');
insert into LivLivros values (default, 'Solaris','Stanisław Lem','Aleph',2021,'Cientistas em uma estação espacial enfrentam manifestações do planeta consciente Solaris.',45, 1, '');
insert into LivLivros values (default, 'A Biblioteca da Meia-Noite','Matt Haig ','Bertrand Brasil',2021,'Nora Seed está à beira do desespero quando descobre a existência de uma biblioteca mágica entre a vida e a morte. Cada livro ali representa uma versão diferente de sua vida. Ao explorar esses caminhos alternativos, ela precisa decidir o que realmente faz a vida valer a pena.',46, 1, '');
insert into LivLivros values (default, 'Duna','Frank Herbert','Aleph',2009,'Em um futuro distante, o jovem Paul Atreides é enviado com sua família ao planeta desértico Arrakis, onde uma substância valiosa chamada “melange” é disputada por impérios inteiros. Em meio a conspirações, traições e profecias, Paul descobre que seu destino está profundamente ligado ao futuro do universo.',47, 1, '');
insert into LivLivros values (default, 'Messias de Duna: livro 2','Frank Herbert','Aleph',2010,'Anos após os eventos de Duna, Paul Atreides agora governa o universo, mas lida com as consequências de seu império religioso e presságios sobre seu futuro.',48, 1, '');
insert into LivLivros values (default, 'Filhos de Duna : livro 3 ','Frank Herbert','Aleph',2011,'Os filhos gêmeos de Paul enfrentam ameaças externas e internas enquanto tentam preservar a visão de futuro do pai.',49, 1, '');
insert into LivLivros values (default, 'O Imperador-Deus de Duna : livro 4 ','Frank Herbert','Aleph',2012,'Milhares de anos depois, Leto II, filho de Paul, se funde com uma criatura para prolongar sua vida e manter seu império, governando como uma divindade tirânica para moldar o destino da humanidade.',50, 1, '');
insert into LivLivros values (default, 'Hereges de Duna : livro 5 ','Frank Herbert','Aleph',2013,'Após o fim do império de Leto II, o universo tenta se reorganizar. Novas facções surgem, como as Honradas Matres, e a luta pelo controle da especiaria continua.',51, 1, '');
insert into LivLivros values (default, 'As Herdeiras de Duna : livro 6 ','Frank Herbert','Aleph',2014,'A irmandade Bene Gesserit enfrenta uma guerra contra as Honradas Matres, enquanto tenta preservar os últimos conhecimentos do império.',52, 1, '');
insert into LivLivros values (default, 'O Apanhador no Campo de Centeio','J.D. Salinger','Editora do Autor',2017,'Holden Caulfield, um adolescente de 16 anos, narra sua experiência após ser expulso do colégio interno Pencey. Ele vagueia por Nova York por três dias, evitando voltar para casa e confrontar seus pais. Holden critica a "falsidade" do mundo adulto, enquanto lida com sua depressão não diagnosticada e a morte recente do irmão Allie. A história explora sua solidão, tentativas fracassadas de conexão (como com a prostituta Sunny) e seu desejo de ser "o apanhador no campo de centeio" - alguém que protege as crianças da queda para a vida adulta.',53, 1, '');
insert into LivLivros values (default, 'The Foxhole Court (Vol. 1)','Self-published','Nora Sakavic ',2013,'Neil Josten, um jovem com um passado obscuro, entra para o time universitário de Exy, um esporte fictício violento. Tentando passar despercebido, ele acaba envolvido com os Foxes, uma equipe disfuncional cheia de conflitos, especialmente com Andrew Minyard — um colega tão imprevisível quanto perigoso.',54, 1, '');
insert into LivLivros values (default, 'The Raven King (Vol.2)','Self-published','Nora Sakavic ',2013,'Neil se vê cada vez mais envolvido com os Foxes e não consegue mais esconder seu passado. Enquanto os conflitos aumentam dentro e fora das quadras, laços são formados e a tensão com a máfia cresce.',55, 1, '');
insert into LivLivros values (default, 'The King’s Men (Vol.3)','Self-published','Nora Sakavic ',2014,'No último livro da trilogia, Neil e os Foxes enfrentam seus maiores inimigos. Em meio a confrontos brutais, segredos revelados e traumas à flor da pele, o grupo finalmente tem a chance de lutar por liberdade — e por si mesmos.',56, 1, '');
insert into LivLivros values (default, 'Bem-vindos à Livraria Hyunam-Dong','Hwang Bo-reum','Intrínseca',2023,'Após abandonar uma carreira estressante, Yeong-ju decide abrir uma pequena livraria em um bairro tranquilo de Seul. Lá, ela encontra reconexão consigo mesma e com os leitores que cruzam seu caminho. A obra celebra a quietude, os livros e os laços criados no cotidiano.',57, 1, '');
insert into LivLivros values (default, 'Os Sete Maridos de Evelyn Hugo','Taylor Jenkins Reid','Paralela ',2019,'A famosa e reclusa atriz Evelyn Hugo decide, aos 79 anos, contar sua história de vida para a jornalista Monique Grant. Ao longo de suas revelações, Evelyn narra sua ascensão ao estrelato, seus amores, escândalos e os sete maridos que teve. À medida que a história se desenrola, segredos são desvendados, e Monique se vê cada vez mais envolvida na vida da atriz, desafiando suas próprias concepções sobre o amor e a fama.',58, 1, '');
insert into LivLivros values (default, 'O Aleph','Jorge Luis Borges','Companhia das Letras',2008,'Coletânea de contos que exploram o infinito, o tempo e a realidade.',59, 1, '');
insert into LivLivros values (default, 'O Retrato de Dorian Gray','Oscar Wilde','Penguin Companhia',2012,'Um jovem permanece eternamente belo enquanto seu retrato envelhece e revela sua decadência moral.',60, 1, '');
insert into LivLivros values (default, 'As Cidades Invisíveis','Italo Calvino','Companhia das Letras',1990,'Marco Polo descreve cidades fantásticas ao imperador Kublai Khan.',61, 1, '');
insert into LivLivros values (default, 'A Menina que Roubava Livros','Markus Zusak','Intrínseca',2013,'Durante a Segunda Guerra Mundial, uma menina encontra consolo nos livros e nas palavras.',62, 1, '');
insert into LivLivros values (default, 'As Benevolentes','Jonathan Littell','Alfaguara',2007,'Um ex-oficial nazista narra os horrores do regime de dentro.',63, 1, '');
insert into LivLivros values (default, 'O Pequeno Príncipe','Antoine de Saint-Exupéry','HarperCollins',2018,'Um piloto perdido no deserto encontra um pequeno príncipe vindo de outro planeta. Durante os diálogos, o príncipe compartilha histórias de seus encontros em outros asteroides, refletindo sobre o comportamento dos adultos, o amor, a solidão e a essência das coisas invisíveis aos olhos.',64, 1, '');
insert into LivLivros values (default, 'Alice no País das Maravilhas','Lewis Carroll','Zahar',2015,'Alice, uma menina curiosa, segue um Coelho Branco apressado e cai em um buraco que a leva a um mundo surreal. Lá, ela encontra criaturas como o Chapeleiro Maluco, a Lagarta azul e a Rainha de Copas, que grita "Cortem suas cabeças!". O livro é uma jornada através da lógica absurda do País das Maravilhas, onde Alice muda de tamanho constantemente após comer ou beber coisas mágicas, participa de um chá louco e enfrenta um julgamento ridículo. A história critica a rigidez da era vitoriana através do nonsense e da sátira.',65, 1, '');
insert into LivLivros values (default, 'A Sangue Frio','Truman Capote','Companhia das Letras',2003,'Relato jornalístico de um crime brutal em uma pequena cidade americana.',66, 1, '');
insert into LivLivros values (default, 'O Velho e o Mar','Ernest Hemingway','Bertrand Brasil',2013,'Um velho pescador luta contra um enorme peixe em alto-mar.',67, 1, '');
insert into LivLivros values (default, 'As Aventuras de Sherlock Holmes','Arthur Conan Doyle','Zahar',2011,'Coletânea de contos sobre os casos solucionados pelo detetive Sherlock Holmes.',68, 1, '');
insert into LivLivros values (default, 'A Metamorfose','Franz Kafka','Principis',2019,'Um homem acorda transformado em um inseto e enfrenta a rejeição da família e da sociedade.',69, 1, '');
insert into LivLivros values (default, 'Cem Anos de Solidão','Gabriel García Márquez','Record',1977,'A saga da família Buendía ao longo de várias gerações em Macondo, misturando realidade e fantasia.',70, 1, '');
insert into LivLivros values (default, 'A Casa dos Espíritos','Isabel Allende','Bertrand Brasil',2017,'A saga de uma família chilena com toques de realismo mágico e política.',71, 1, '');
insert into LivLivros values (default, 'Vou te Receitar um Gato','Syou Ishida','Intrínseca',2024,'Uma coletânea de crônicas poéticas e delicadas, em que cada texto é uma “receita” de um gato para diferentes dores emocionais: tristeza, solidão, ansiedade, luto. Com traços suaves e reflexões sensíveis, o autor entrega conforto através da presença simbólica desses gatos “prescritos” como alívio para a alma.',72, 1, '');
insert into LivLivros values (default, 'Vou te Receitar outro Gato ','Syou Ishida','Intrínseca',2024,'Continuação do sucesso “Vou te Receitar um Gato”, este segundo volume amplia o cuidado com novas situações emocionais e novos gatos "curadores". Ainda mais sensível, o livro acompanha estados como nostalgia, insegurança e saudade, oferecendo palavras e imagens como forma de afago.',73, 1, '');
insert into LivLivros values (default, 'Anna Kariênina','Liev Tolstói','Editora 34',2021,'A trajetória trágica de uma mulher dividida entre a paixão e as convenções sociais.',74, 1, '');
insert into LivLivros values (default, ' Tudo é rio','Carla Madeira','Record ',2014,'A história gira em torno de três personagens marcantes: Dalva, uma prostituta intensa; Venâncio, um homem dividido; e Lucy, uma mulher devastada por uma tragédia. Entre culpa, desejo e amor, o livro navega pelas águas turbulentas das emoções humanas com lirismo e intensidade.',75, 1, '');
insert into LivLivros values (default, ' Três','Valérie Perrin','Intrínseca',2023,'Adrien, Étienne e Nina são amigos inseparáveis desde os anos 1980. Ao longo das décadas, suas vidas se entrelaçam entre promessas, segredos e rupturas. Quando um carro é encontrado submerso em um lago, antigos mistérios vêm à tona e o passado retorna com força.',76, 1, '');
insert into LivLivros values (default, 'Pessoas normais','Sally Rooney','Companhia das Letras',2020,'Connell e Marianne cresceram na mesma cidade na Irlanda, mas vivem realidades diferentes: ele é popular e reservado; ela, solitária e rica. Quando começam um relacionamento secreto, a conexão entre eles se torna profunda e confusa. Ao longo dos anos, suas vidas se cruzam e se afastam, enquanto lidam com amadurecimento, traumas e o que significa amar — e ser amado.',77, 1, '');
insert into LivLivros values (default, ' Amor(es) Verdadeiro(s)','Taylor Jenkins Reid','Paralela',2020,'Emma Blair vive o amor da sua vida ao lado de Jesse, com quem casa e constrói planos. Mas quando ele desaparece em um acidente aéreo e é dado como morto, Emma tenta seguir em frente — até reencontrar Sam, um velho conhecido. Anos depois, Jesse reaparece vivo, e Emma se vê dividida entre dois amores reais, intensos e transformadores.',78, 1, '');
insert into LivLivros values (default, 'Teto Para Dois','Beth OLeary','Paralela',2020,'Tiffy e Leon são dois desconhecidos que dividem um apartamento em Londres - ela fica durante o dia (enquanto trabalha como editora de livros de artesanato), e ele à noite (enquanto trabalha como enfermeiro em turnos). A comunicação através de bilhetes evolui para uma amizade, até que um erro no calendário os faz se conhecer pessoalmente. Enquanto Tiffy tenta superar um relacionamento tóxico, Leon luta para ajudar seu irmão injustamente preso. A química entre os dois é inegável, mas seus problemas pessoais ameaçam o romance nascente.',79, 1, '');
insert into LivLivros values (default, 'A Hipótese do Amor','Ali Hazelwood','Paralela ',2022,'Olive Smith, uma jovem estudante de doutorado, finge estar em um relacionamento com Adam Carlsen, um dos professores mais renomados e temidos da universidade. O objetivo de Olive é afastar a atenção de um colega, mas as coisas tomam um rumo inesperado quando a atração entre ela e Adam se torna inegável. A história mistura romance com um toque de humor e ciência, enquanto os dois lidam com as inseguranças de suas profissões e suas emoções.',80, 1, '');
insert into LivLivros values (default, 'Jane Eyre','Charlotte Brontë','Zahar',2018,'A trajetória de uma órfã que enfrenta preconceitos sociais em busca de amor e independência.',81, 1, '');
insert into LivLivros values (default, 'A Seleção (Livro 1)','Kiera Cass','Seguinte',2013,'Em um reino dividido em castas, America Singer, uma Cinco, é forçada pela família a se inscrever na Seleção - um concurso onde 35 garotas competem pelo coração do príncipe Maxon e pelo trono. Relutante no início, America não deseja deixar seu amor secreto, Aspen, um Seis. Porém, ao conhecer Maxon, ela descobre que o príncipe é muito diferente do que imaginava. Enquanto intrigas palacianas e rebeliões externas ameaçam o processo, America precisa decidir entre seu passado humilde e um futuro que poderia mudar sua vida e todo o reino.',82, 1, '');
insert into LivLivros values (default, 'A Elite (Livro 2)','Kiera Cass','Seguinte',2013,'America sobreviveu à primeira fase da Seleção, mas agora está entre as seis finalistas - a Elite. Enquanto seu relacionamento com Maxon se aprofunda, a tensão política aumenta: rebeldes atacam o palácio e segredos sobre a monarquia vêm à tona. America também enfrenta conflitos internos quando Aspen, seu primeiro amor, reaparece como guarda real. Dividida entre dois mundos e dois amores, ela precisa tomar decisões que afetarão não apenas seu coração, mas o futuro de toda a nação.',83, 1, '');
insert into LivLivros values (default, 'A Escolha (Livro 3)','Kiera Cass','Seguinte',2014,'O ápice da Seleção chegou: resta apenas America e mais duas candidatas. Enquanto o reino se recupera de ataques rebeldes, Maxon precisa escolher uma noiva, mas America ainda hesita entre seu amor pelo príncipe e seu passado com Aspen. Quando um segredo chocante sobre a família real é revelado, America se vê no centro de uma conspiração que pode destruir tudo. Neste desfecho emocionante, lealdades são testadas e America precisará fazer a escolha mais difícil de todas - seguir a tradição ou lutar por um novo futuro.',84, 1, '');
insert into LivLivros values (default, 'A Herdeira (Livro 4)','Kiera Cass','Seguinte',2016,'Vinte anos após a Seleção de America, sua filha Eadlyn se torna a primeira princesa a realizar sua própria Seleção. Determinada a provar que não precisa se casar, ela transforma o concurso em um jogo político. Porém, quando a crise econômica se agrava e o povo exige mudanças, Eadlyn percebe que seu coração pode estar em jogo - especialmente com o misterioso Erik e o charmoso Hale. Esta nova geração enfrenta desafios ainda maiores, pois a monarquia precisa se reinventar para sobreviver.',85, 1, '');
insert into LivLivros values (default, 'Ensaio sobre a Cegueira','José Saramago','Companhia das Letras',2020,'Uma epidemia de cegueira revela o colapso da sociedade e a fragilidade da civilização.',86, 1, '');
insert into LivLivros values (default, 'Orgulho e Preconceito ','Jane Austen','Martin Claret',2018,'Elizabeth Bennet é uma jovem espirituosa que vive em um ambiente onde o casamento é a maior expectativa feminina. Ela enfrenta o orgulhoso Sr. Darcy, e os dois passam por transformações internas à medida que enfrentam seus preconceitos.',87, 1, '');
insert into LivLivros values (default, 'Razão e Sensibilidade','Jane Austen','Martin Claret',2018,'As irmãs Dashwood, Elinor (razão) e Marianne (sensibilidade), enfrentam as perdas da família e os altos e baixos do amor. Cada uma precisa encontrar equilíbrio entre emoção e racionalidade.',88, 1, '');
insert into LivLivros values (default, 'Persuasão','Jane Austen','Martin Claret',2018,'Anne Elliot, aos 27 anos, reencontra o homem que foi convencida a recusar anos antes. Entre arrependimentos e esperança, a história explora a delicadeza de um amor maduro.',89, 1, '');
insert into LivLivros values (default, 'A Hora da Estrela','Clarice Lispector','Rocco',2020,'A vida e morte de Macabéa, uma nordestina invisibilizada na cidade grande.',90, 1, '');
insert into LivLivros values (default, 'O Lobo da Estepe','Hermann Hesse','Record',2020,'Harry Haller luta entre seus instintos primitivos e a racionalidade em uma jornada de autodescoberta.',91, 1, '');
insert into LivLivros values (default, 'Os Detetives Selvagens','Roberto Bolaño','Companhia das Letras',2006,'Dois poetas viajam pelo México e pelo mundo em busca de uma poetisa desaparecida.',92, 1, '');
insert into LivLivros values (default, 'Os Irmãos Karamázov','Fiódor Dostoiévski','Editora 34',2019,'Um drama familiar que envolve fé, culpa e assassinato.',93, 1, '');
insert into LivLivros values (default, 'A Insustentável Leveza do Ser','Milan Kundera','Companhia das Letras',2017,'Amores e escolhas pessoais em meio à invasão soviética em Praga.',94, 1, '');
insert into LivLivros values (default, 'Frankenstein: O Clássico Está Vivo!','Mary Shelley','DarkSide',2017,'Victor Frankenstein, um jovem cientista obcecado pelos segredos da vida, desafia os limites da ciência e cria uma criatura feita de partes humanas. Ao ser rejeitado por seu criador e pelo mundo, a criatura desenvolve sentimentos intensos de dor e vingança. Esta edição traz o texto original com uma apresentação visual única, celebrando a força da obra gótica escrita por Mary Shelley aos 18 anos.',95, 1, '');
insert into LivLivros values (default, 'O Morro dos Ventos Uivantes','Emily Brontë','Principis',2019,'A história narra a relação intensa, obsessiva e muitas vezes destrutiva entre Heathcliff e Catherine Earnshaw, ambientada nos campos sombrios e tempestuosos de Yorkshire. Com paixão e vingança como forças motrizes, o romance transita entre gerações e revela o impacto do amor e do ódio em suas formas mais extremas.',96, 1, '');
insert into LivLivros values (default, 'O Leopardo','Giuseppe Tomasi di Lampedusa','Companhia das Letras',2017,'A decadência da aristocracia siciliana durante a unificação italiana.',97, 1, '');
insert into LivLivros values (default, 'A Culpa é das Estrelas','John Green','Intrínseca',2012,'Hazel Grace Lancaster, uma adolescente com câncer terminal, é forçada por seus pais a participar de um grupo de apoio. Lá, conhece Augustus Waters, um ex-jogador de basquete que perdeu uma perna para o osteossarcoma. Os dois se apaixonam enquanto discutem livros, medo do esquecimento e suas filosofias de vida. Augustus usa seu "Desejo Genérico" (programa para doentes terminais) para levar Hazel a Amsterdã, onde encontram o autor recluso de seu livro favorito. A viagem é perfeita, mas o câncer de Augustus retorna com força, levando a um desfecho emocionante sobre amor, perda e legado.',98, 1, '');
insert into LivLivros values (default, 'Eleanor & Park','Rainbow Rowell','Novo Conceito',2014,'Eleanor, uma garota de cabelo vermelho e estilo excêntrico, é a novata na escola. Park, um meio-coreano fã de quadrinhos, é obrigado a dividir o assento do ônibus com ela. Inicialmente relutantes, eles se conectam através de mix tapes e histórias em quadrinhos. O romance enfrenta obstáculos como o bullying dos colegas, a família abusiva de Eleanor e as diferenças sociais entre eles. A narrativa alterna entre as perspectivas dos dois, capturando a intensidade do primeiro amor e a dor de crescer em ambientes difíceis.',99, 1, '');
insert into LivLivros values (default, 'Com Amor, Simon','Becky Albertalli','Seguinte',2018,'Simon Spier é um adolescente gay no armário que se comunica anonimamente por e-mail com "Blue", um colega também gay de sua escola. Quando suas mensagens são descobertas por Martin, ele é chantageado: se não ajudar Martin a conquistar uma garota, seu segredo será revelado. Enquanto tenta descobrir quem é Blue (entre suspeitos como o atlético Bram e o tímido Cal), Simon lida com a aceitação da família, amigos e, principalmente, de si mesmo. Uma história doce sobre identidade, amizade e o medo de ser quem você é.',100, 1, '');
insert into LivLivros values (default, 'O Nome da Rosa','Umberto Eco','Record',2019,'Um monge investiga assassinatos misteriosos em um mosteiro medieval.',101, 1, '');
insert into LivLivros values (default, ' Uma Vida Pequena','Hanya Yanagihara','Record',2016,'Em meio ao caos e à beleza de Nova York, quatro amigos — Jude, Willem, JB e Malcolm — constroem suas vidas, carreiras e afetos. No centro da narrativa está Jude, um homem brilhante e reservado, cuja história marcada por traumas e silêncios se revela pouco a pouco. A obra é um mergulho profundo nas dores invisíveis, na complexidade dos laços humanos e na esperança que resiste mesmo diante do sofrimento extremo.',102, 1, '');
insert into LivLivros values (default, 'Crime e Castigo','Fiódor Dostoiévski','Editora 34',2016,'A história de um estudante que comete um assassinato e enfrenta consequências psicológicas e morais.',103, 1, '');
insert into LivLivros values (default, 'Madame Bovary','Gustave Flaubert','Penguin Companhia',2011,'Emma busca sentido em sua vida burguesa por meio de amores e ilusões.',104, 1, '');
insert into LivLivros values (default, 'Os Miseráveis','Victor Hugo','Penguin Companhia',2021,'A saga de Jean Valjean, um ex-presidiário tentando se redimir em uma França desigual.',105, 1, '');
insert into LivLivros values (default, 'O Sol é Para Todos','Harper Lee','José Olympio',2019,'Uma menina observa o racismo e a injustiça na sua cidade durante um julgamento.',106, 1, '');
insert into LivLivros values (default, 'Verity','Collen Hoover ','Galera Record ',2021,'Lowen, uma escritora em dificuldades, é contratada para terminar a série de livros de Verity Crawford, uma autora renomada em coma após um acidente. Ao se mudar para a casa da família, ela encontra uma autobiografia inacabada que revela segredos sombrios — e perturbadores — sobre o passado de Verity.',107, 1, '');
insert into LivLivros values (default, 'O Código Da Vinci','Dan Brown','Arqueiro',2021,'Um simbologista investiga assassinatos ligados a um segredo milenar dentro da Igreja.',108, 1, '');
insert into LivLivros values (default, 'O Silêncio dos Inocentes','Thomas Harris','Record',2019,'Uma jovem agente do FBI busca ajuda de um assassino preso para capturar outro serial killer.',109, 1, '');
insert into LivLivros values (default, 'Mentirosos','E. Lockhart','Seguinte',2015,'A família Sinclair passa todos os verões em sua ilha privada, mas no verão em que Cadence tem 15 anos, um "acidente" a deixa com amnésia e dores crônicas. Aos poucos, ela reconstitui a verdade sobre o que aconteceu com suas primas Mirren e Penny e seu primo Gat (por quem era apaixonada). A narrativa não-linear revela segredos sombrios: ciúmes, disputas por herança e um pacto macabro. O desfecho chocante expõe como as mentiras da família destruíram os quatro jovens.',110, 1, '');
insert into LivLivros values (default, 'O Iluminado','Stephen King',' Suma',2012,'Jack Torrance aceita o emprego de zelador no isolado Hotel Overlook durante o inverno, esperando recomeçar a vida ao lado da esposa e do filho, Danny — que possui uma habilidade psíquica chamada "iluminação". À medida que o isolamento se intensifica, forças sobrenaturais e os próprios fantasmas de Jack começam a ameaçar a sanidade da família. Uma das obras mais icônicas do terror psicológico moderno.',111, 1, '');
insert into LivLivros values (default, 'A Dança da Morte','Stephen King','Suma',2013,'Um vírus mortal dizima a população e inicia uma luta entre o bem e o mal.',112, 1, '');*/